  standalone: true,
  imports: [ 
    HttpClientModule
  ],
  templateUrl: './front-page.component.html',
  styleUrls: ['./front-page.component.css']
})
export class FrontPageComponent implements OnInit {
  newdata:any;

  constructor(private http: HttpClient) { }

  ngOnInit() {
	this.getData();
  }

  getData() {
